INSERT INTO `user` (`id`, `userName`, `userAccount`, `userPassword`, `userAvatar`, `gender`, `phone`, `email`, `userRole`, `tags`, `createTime`, `updateTime`, `isDelete`, `userProfile`) VALUES (600007, 'Tony12138', 'zijuziju', '8b8a9bac6ac20279f6ef4a0b78cc3637', 'https://img01.yohoboys.com/contentimg/2018/11/22/13/0187be5a52edcdc999f749b9e24c7815fb.jpg', 0, '3278326432', '123@123.com', 0, '[\"乐观\",\"大二\",\"Python\",\"工作\"]', '2023-05-26 16:37:01', '2023-05-26 17:51:18', 0, '你好，我是一个充满激情和创造力的人。我的名字是小希，我来自中国北京。我热爱学习新事物和挑战自己的极限，这种精神驱使我不断地探索未知领域，尝试新的技能和经验。我喜欢音乐、阅读、旅游和运动，这些活动让我感受到生命的美好和无限可能性。我还热衷于社交媒体和数字营销，致力于利用互联网技术为更多人带来价值和影响力。我相信只要保持积极的心态和努力不懈的精神，我们每个人都能成为更好的自己。');
